import React from "react";
import {Link} from "react-router-dom";



class SearchDetailsComponent extends React.Component {
    findJoke = (jokeId) => {
        console.log(jokeId);
        fetch(`https://icanhazdadjoke.com/j/${jokeId}`, {
            headers: {
                Accept: "application/json"
            }
        })
            .then(response => response.json()).then(this.test)
    };

    testing = () => {
        console.log(this.findJoke("e2obFd2oOf"))
    };

    test = (search) => {
        console.log(search);
        return search.joke
    };
    
    render() {
        return (
            <div className={"container-fluid"}>
                <h1>boo: {this.findJoke(this.props.resultId)}</h1>
                <h1>Test: {this.testing()}</h1>
                <img src={`https://icanhazdadjoke.com/j/${this.props.resultId}.png`} alt={"Joke"} width="900" height="150"/>
                <br/>
                <h5>Users who have saved this joke:</h5>
                <ul>
                    {/*
                    Below should be fetched from local API
                    Find users that currently have the particular resultId saved as public note
                    */}
                    <li>
                        <Link to={"/profiles/user1"}>
                            User 1
                        </Link>
                    </li>
                    <li>
                        <Link to={"/profiles/user2"}>
                            User 2
                        </Link>
                    </li>
                    <li>
                        <Link to={"/profiles/user3"}>
                            User 3
                        </Link>
                    </li>
                    <li>
                        <Link to={"/profiles/user4"}>
                            User 4
                        </Link>
                    </li>
                    <li>
                        <Link to={"/profiles/user5"}>
                            User 5
                        </Link>
                    </li>
                </ul>
            </div>
        );
    }
}

export default SearchDetailsComponent
